import React from "react";

function Viewport(props) {
  const imgLinks = props.src;
  return (
    <div>
      {imgLinks.map((imgUrl) => {
        return <img src={imgUrl} alt="Design Section" />;
      })}
    </div>
  );
}

export default Viewport;
